import React, { Component } from 'react';
import { Button } from 'react-bootstrap';

class Far extends Component {
    state = { 
        name: "nasir",
        bttext: "I am a big button"
     };


    render() { 
        return ( 
        <div>
            <span>Hello {this.state.name}</span> 
            <br></br>
            <Button className = "btn btn-success">{this.state.bttext}</Button>
        </div>
        );
    }
}

export default Far;
